div.script:
             function wshutdown(){

	jQuery(".dropdown").css("display","none");

	jQuery(".select-click").removeClass("labelactive");

	jQuery("#hidelight-show-id").removeClass("hidelight-show");

	if(jQuery(".color-hidelight")) jQuery(".color-hidelight").attr("style"," ");

	jQuery("#fang-select").css("display","block");


}
function addlabelclass(){
	if(jQuery(".dropdown").css("display")=="none"){

		jQuery(".select-click").addClass("labelactive");

		jQuery(".dropdown").css("display","block"); 

		//jQuery(".wrapper").append('
 ');

		jQuery("#hidelight-show-id").addClass("hidelight-show");

		jQuery("#fang-select").css("display","none");

	}else{

		if(jQuery(".color-hidelight")) jQuery(".color-hidelight").remove();

		 jQuery("#hidelight-show-id").removeClass("hidelight-show");

		jQuery(".select-click").removeClass("labelactive");

		jQuery(".dropdown").css("display","none");

		jQuery("#fang-select").css("display","block");

	}

}
function clearHov(){
	jQuery(".pop-color ul li").removeClass("hov");
	}

                $(function(){
$(".list_name_id_1").click(function(){
var value_id=$(this).attr("rel");
var value_text=$("#valule_text_"+value_id).html();
$(".list_name_id_1").removeClass("attr_selected");
$(this).addClass("attr_selected");
$("#attrib-1").val(value_id);
$("#tips_1").html("You choose Size -"+value_text+"");
});
$("form[name=\"cart_quantity\"]").submit(function(){
var value_id=$("#attrib-1").val();
if(value_id==''){
$("#tips_1").html("* Please choose Size");
return false;
}
});
});

             $(document).ready(function(){  

var dd="$";

var shuzhi="24.00";

var jiashuzhi="96.00";

var add,reduce,num,num_txt;  

add=$(".J_add");//娣诲姞鏁伴噺  

reduce=$(".J_minus");//鍑忓皯鏁伴噺  

num="";//鏁伴噺鍒濆鍊? 

num_txt=$(".J_input");//鎺ュ彈鏁伴噺鐨勬枃鏈     

//var num_val=num_txt.val();//缁欐枃鏈闄勪笂鍒濆鍊? 

//鏂囨湰妗嗗彉鏇寸殑鏂规硶

$(".J_input").change(function() {

var num = $(this).val();

if(jiashuzhi!=0){

if(shuzhi!=0){

$('#p_price').html(''+dd+jiashuzhi*num+''+dd+shuzhi*num+'');

}else{

$('#p_price').html(dd+jiashuzhi*num);

}

}else{

$('#p_price').html(dd+shuzhi*num);

}	

});

/*娣诲姞鏁伴噺鐨勬柟娉?*/  

add.click(function(){  

num = $(".J_input").val();      

num++;  

num_txt.val(num);

if(jiashuzhi!=0){

if(shuzhi!=0){

$('#p_price').html(''+dd+jiashuzhi*num+''+dd+shuzhi*num+'');

}else{

$('#p_price').html(dd+jiashuzhi*num);

}

}else{

$('#p_price').html(dd+shuzhi*num);

}	

});  

/*鍑忓皯鏁伴噺鐨勬柟娉?*/   

reduce.click(function(){  

num = $(".J_input").val();

if(num >0){

if(num==1)  

{  num_txt.val("1");  

}  

else  

{  

num--;  

num_txt.val(num);  

}  

if(jiashuzhi!=0){

if(shuzhi!=0){

$('#p_price').html(''+dd+jiashuzhi*num+''+dd+shuzhi*num+'');

}else{

$('#p_price').html(dd+jiashuzhi*num);

}

}else{

$('#p_price').html(dd+shuzhi*num);

}	

}  

});  

})
